import React from 'react';
import Input from './inputComponent';

export default function ProjetoBase() {
  return (
    <div className="container">
      <h2>react-text-transformer</h2>
      <Input id="textoPrincipal" title="Digite:"/>
      <h3>Transformações</h3>
      <Input id="invertido" title="Texto invertido:"/>
      <Input id="numerico" title="Texto numérico:"/>
      <Input id="csv" title="Csv:"/>
      <Input id="slug" title="Slug:"/>
      <Input id="vogais" title="Somente vogais:"/>
      <Input id="consoantes" title="Somente consoantes:"/>
      <Input id="Variavel" title="Variável:"/>
    </div>
  );
}
